    Translator.add("modules.close_down_project.description", "Der finale Projektbericht dient als ein endg\u00fcltiges Dokument f\u00fcr die Evaluation des Projektes und f\u00fcr die Planung der verbleibenden Aufgaben und der Nachprojektphase. Der Projektabschlussbericht ist die Basis f\u00fcr den endg\u00fcltigen Inbetriebnahmeprozess.", "messages", "de");
    Translator.add("modules.close_down_project.title", "Projektabschlussbericht", "messages", "de");
    Translator.add("modules.contract.description", "Das Ziel des Projektvertrages ist, eine schriftliche Vereinbarung zwischen dem Projektsponsor und dem Projektmanager zu schaffen. Diese Vereinbarung sollte eine kurze Beschreibung der Rahmenbedingungen des Projektes, sowie der Nutzung der ben\u00f6tigten Resourcen f\u00fcr das Vorhaben.", "messages", "de");
    Translator.add("modules.contract.title", "Vertrag", "messages", "de");
    Translator.add("modules.decisions.description", "Im \"Entscheidungs\"-Modul kannst du deine Entscheidungen, die du w\u00e4hrend der Projektdurchf\u00fchrung getroffen hast, dokumentieren.", "messages", "de");
    Translator.add("modules.decisions.title", "Entscheidungen", "messages", "de");
    Translator.add("modules.external_costs.description", "Ressourcenplanung erlaubt Ihnen die Personalkosten pro Arbeitspaket zu kalkulieren.", "messages", "de");
    Translator.add("modules.external_costs.title", "Externe Kosten", "messages", "de");
    Translator.add("modules.gantt_chart.description", "Das Gantt Diagramm ist eine Standartdarstellung aller Phasen, Arbeitspakete, Aufgaben und Meilensteine auf einer Zeitleiste gem\u00e4\u00df der geplanten Projektausf\u00fchrung. Alle Objekte haben einen zugeh\u00f6riges Start- und Enddatum und werden als eigenst\u00e4ndige Balken auf der Zeitachse dargestellt. Korrelationen zwischen den Objekten - beispielsweise V\u00f6rg\u00e4nger- und Nachfolgeaufgaben - k\u00f6nnen ebenfalls definiert und dargestellt werden.", "messages", "de");
    Translator.add("modules.gantt_chart.title", "Gantt Diagramm", "messages", "de");
    Translator.add("modules.infos.description", "Im Info-Modul k\u00f6nnen allgemeine Informationen zum deinem Projekt oder deinen Teams dokumentiert werden. Informationen, wie beispielsweise Projektumfang, neue Projektmitglieder, neue Veranstaltungen, etc.", "messages", "de");
    Translator.add("modules.infos.title", "Infos", "messages", "de");
    Translator.add("modules.internal_costs.description", "Projektkosten zu \u00fcberblicken ist essentiell. Die Kostenplanung erlaubt Ihnen die Kosten pro Arbeitspaket und somit die Gesamtkosten des Projektes zu kalkulieren. Es wird zwischen externen und internen Kosten sowie operativen Kosten und Investments unterschieden.", "messages", "de");
    Translator.add("modules.internal_costs.title", "Interne Kosten", "messages", "de");
    Translator.add("modules.meetings.description", "CAMPR unterst\u00fctzt dich, Meetings mit den Projektbeteiligten zu koordinieren. Du kannst Einladungen f\u00fcr Meetings erstellen, Meetings planen und sie verfolgen. Au\u00dferdem k\u00f6nnen Meetingprotokolle in strukturierter Form hinzugef\u00fcgt und an alle relevanten Teilnehmer gem\u00e4\u00df der vorgefertigten Verteilerlisten versendet werden. .", "messages", "de");
    Translator.add("modules.meetings.title", "Meetings", "messages", "de");
    Translator.add("modules.organization.description", "Die Projektorganisation zeigt die Projektbeteiligten in hierarchischer Ordnung. Dieses Modul visualisiert das Projektorganisationschart, definiert die Rollen und die Beziehungen zwischen den Projektteams. Au\u00dferdem k\u00f6nnen Sie Distributionslisten f\u00fcr Reports und Meetingeinladungen erstellen.", "messages", "de");
    Translator.add("modules.organization.title", "Organisation", "messages", "de");
    Translator.add("modules.phases_and_milestones.description", "Arbeitspakete k\u00f6nnen in Phasen gem\u00e4\u00df der Projektsequenzen gruppiert werden. Besonders wichtige Events im Projektverlauf k\u00f6nnen als Meilensteine definiert und terminiert werden.", "messages", "de");
    Translator.add("modules.phases_and_milestones.title", "Phasen & Meilensteine", "messages", "de");
    Translator.add("modules.rasci_matrix.description", "Die Veranwortlichkeitsmatrix zeigt die Mitwirkung von unterschiedlichen Rollen bei der Fertigstellung von Aufgaben und anderen Leistungen in der Projektausf\u00fchrung. Die Verantwortlichkeitsmatrix ist besonders n\u00fctzlich, um Rollen und Zust\u00e4ndigkeiten in bereichs\u00fcbergreifenden Projekten und Prozessen festzulegen. RASCI steht f\u00fcr die f\u00fcnf unterschiedlichen Rollen in der Ausf\u00fchrung von Arbeitspaketen oder Aufgaben: Responsible (verantwortlich), Accountable (rechenschaftspflichtig), Supportive (unterst\u00fctzend), Consulted (beratend) and Informed (informiert).", "messages", "de");
    Translator.add("modules.rasci_matrix.title", "RASCI-Matrix", "messages", "de");
    Translator.add("modules.risks_and_opportunities.description", "Regul\u00e4re Risikoanalyse, um potentielle Gefahren und ungenutzte Potentiale im Projekt aufzudecken und Situationen proaktiv anzugehen. Dieses Modul unterst\u00fctzt Sie dabei Risiken und Chancen zu sammeln, strukturieren, verfolgen und zu visualisieren.", "messages", "de");
    Translator.add("modules.risks_and_opportunities.title", "Risiken & Chancen", "messages", "de");
    Translator.add("modules.status_report.description", "Der Statusbericht liefert Ihnen einen \u00dcberblick \u00fcber den grunds\u00e4tzlichen Zustand des Projektes, bez\u00fcglich Fristen, Ressourcen, Kosten, Organisation und Kontext, sowie den geplanten Ma\u00dfnahmen und notwendigen Entscheidungen.", "messages", "de");
    Translator.add("modules.status_report.title", "Statusbericht", "messages", "de");
    Translator.add("modules.task_management.description", "Die Aufgabenverwaltung liefert einen \u00dcberblick \u00fcber alle Arbeitspakete, die zu Ihrem Projekt geh\u00f6ren. Ein Arbeitspaket ist eine Gruppe verbundener Aufgaben. Typische Kategorien f\u00fcr gruppierte Aufgaben sind beispielsweise geographische Gebiete, Gewerk, Technologie oder die Zeit, die zur Fertigstellung ben\u00f6tigt wird.", "messages", "de");
    Translator.add("modules.task_management.title", "Aufgabenverwaltung", "messages", "de");
    Translator.add("modules.todos.description", "Die zentrale To-Do-Liste dient der Dokumentation der vereinbarten oder notwendigen To-Do's deines Projektes.", "messages", "de");
    Translator.add("modules.todos.title", "TODO's", "messages", "de");
    Translator.add("modules.wbs.description", "Die Work Breakdown Structure (WBS, dt.: Projektstrukturplan (PSP)) ist eine ergebnisorientierte Aufschl\u00fcsselung eines Projektes in kleinere Bestandteile. Ein Projektstrukturplan ist eine Methode, welches die Arbeit der Teams in \u00fcberschaubare Gruppen \/ Arbeitspakete aufschl\u00fcsselt. Dieses Modul visualisiert das Projekt in einem Strukturbaum, mit den Projektphasen, Arbeitspaketen, Aufgaben und Meilensteinen in den Zweigen. Die Struktur kann im Modul zu Zwecken der Restrukturierung bearbeitet werden.", "messages", "de");
    Translator.add("modules.wbs.title", "WBS", "messages", "de");
