    Translator.add("email.workspace.message", "Dein Workspace steht jetzt zur Verf\u00fcgung:", "messages", "de");
    Translator.add("email.workspace.content", "Du findest dort drei Projekte unterschiedlicher Gr\u00f6\u00dfen: Das Firmenjubil\u00e4um, die Maschienenverlagerung und das \"Welcome to CAMPR\"-Projekt. Letzteres ist ein Modellprojekt, welches die Phasen des klassischen Projektmanagementansatzes darstellt. <br\/><br\/>\nWenn du mehr dar\u00fcber erfahren willst inwiefern CAMPR sich nach bew\u00e4hrten Projektmanagement-Standards richtet, lies unseren %link_tag_open% Blogpost %link_tag_close% zu diesem Thema.", "messages", "de");
