    Translator.add("authentication.account_needs_activation", "Dieser Account muss noch aktiviert werden. Bitte \u00fcberpr\u00fcfen deine E-Mails und folge den Instruktionen zur Account-Aktivierung.", "messages", "de");
    Translator.add("portal.page.about.manuel_weiler.about", "                        <p>Hallo, mein Name ist Manuel Weiler und ich arbeite als professioneller Projektmanager mit umfangreicher Erfahrung in Gro\u00dfprojekten im Automobil- und Technologiesektor.<\/p>\n\n                        <p>Mein Hintergrund als Maschinenbauingenieur bildet die Basis f\u00fcr meine t\u00e4gliche Arbeit in internationalen und interdisziplin\u00e4ren Projekten. In den vergangenen mehr als zehn Jahren war ich f\u00fcr Kunden in Deutschland, China, Rum\u00e4nien und den USA t\u00e4tig.<\/p>\n\n                        <p>Meine Leidenschaft ist es den Herausforderungen von modernen, hoch-komplexen und multikulturellen Arbeitsumfeldern mit ma\u00dfgeschneiderten und kreativen Methoden und Werkzeugen zu begegnen. Mein Ziel ist es kontinuierlich die Kommunikation in Projekten zur verbessern und effektiv Risiken im gesamten Projektverlauf zu managen.<\/p>", "messages", "de");
    Translator.add("portal.page.about.title1", "Ein kraftvolles<br>Projektmanagement<br>Tool", "messages", "de");
    Translator.add("portal.page.about.content1", "CAMPR ist das Tool der Wahl f\u00fcr einen professionellen Projektmanager. Konzipiert f\u00fcr einheitliche Projektplanung und Dokumentation. Der modulare Pr\u00e4sentation aller relevanter Projektmanagement-Methoden erleichtert Ihnen die Einf\u00fchrung eines einheitlichen Projektmanagementstandards in Ihrem Unternehmen. Ob kleine oder gro\u00dfe Projekte: w\u00e4hlen Sie nur die Module aus, die zu Ihrem Projekt passen. Fokussieren Sie sich auf Ihr Projekt - den Rest \u00fcbenrimmt CAMPR.", "messages", "de");
    Translator.add("portal.ui.sign_up", "Anmeldung", "messages", "de");
    Translator.add("portal.page.about.partners.funfpunktnull.desc", "F\u00fcnfpunktnull GmbH ist ein Unternehmen spezialisiert auf Usability und Innovation-Studien mit Sitz in W\u00fcrzburg. Zusammen mit Ihren Kunden erarbeiten Sie L\u00f6sungen f\u00fcr die digitalen Herausforderungen von heute und morgen. Ihr Grundsatz ist die Einbeziehung der Nutzer in allen Entwicklungsphasen. Das Team aus funktions\u00fcbergreifend ausgebildeten Experten f\u00fcr Mensch-Maschinen-Kommunikation wird optimal erg\u00e4nzt durch ihr Partner-Netzwerk.", "messages", "de");
    Translator.add("portal.page.about.partners.uniwurzburg.desc", "Der enge Kontakt zum Lehrstuhl f\u00fcr psychologische Ergonomie erlaubt uns regelm\u00e4\u00dfigen Informationsaustausch \u00fcber die neuesten wissenschaftlichen Erkenntnisse im Bereich Design und die Auswertung der intuitiven Bedienbarkeit.", "messages", "de");
    Translator.add("portal.page.about.partners.zdimainfranken.desc", "ZDI Mainfranken ist ein Startup-Inkubator mit dem Ziel das Potential f\u00fcr innovative digitale Produkte und Gesch\u00e4ftsideen am Standort W\u00fcrzburg zu st\u00e4rken. Ihr Fokus liegt auf der Entwicklungsphase neuer Startups durch Ideengeneration, Prototypenentwicklung und Marktdurchdringungsstrategien. Das ZDI hat ein weites Netz an Partnern in Bayern.", "messages", "de");
    Translator.add("portal.page.about.partners.trisoft.desc", "TRISOFT ist unser Entwicklungspartner f\u00fcr das CAMPR-Tool. Sie sind ein Symfony-orientiertes Softwareentwicklungsunternehmen mit Standort in Rum\u00e4nien und bieten freundliche, schnelle und qualitativ hochwertige L\u00f6sungen.", "messages", "de");
    Translator.add("portal.page.try_beta.title", "Teste CAMPR <b class=\"warning-color\">kostenlos<\/b>", "messages", "de");
    Translator.add("portal.page.try_beta.desc", "                                <p class=\"mt-30\">\n                                    Nutze dieses Registrierungsformular, um CAMPR <b>kostenlos<\/b>\n                                    zu testen. Wir statten dich mit einem Account\n                                    sowie einem Workspace und einigen Beispielprojekten aus, sodass Sie\n                                    CAMPR direkt testen k\u00f6nnen. Vergessen Sie nicht Ihr Feedback mit Hilfe des<b>User\n                                        Feedback-Buttons<\/b> in der Men\u00fcspalte links abzugeben.\n                                <\/p>\n                                <p class=\"mt-30\">\n                                    <a href=\"#contact_us\" class=\"simple-link\"><b>Kontaktiere uns<\/b><\/a> gern, wenn du Fragen hast.\n                                <\/p>", "messages", "de");
    Translator.add("portal.page.dashboard.content1", "Sieht so aus als seist du neu hier. Probiere doch", "messages", "de");
    Translator.add("portal.page.dashboard.create_new_team", "ein neues Team zu erstellen", "messages", "de");
    Translator.add("portal.page.home.content2", "Was ist<br>CAMPR", "messages", "de");
    Translator.add("portal.page.home.content3", "CAMPR ist ein Projektmanagement Tool konzipiert f\u00fcr Projekte jedweder Gr\u00f6\u00dfe. Unsere webbasierte Software ist lean, intuitiv designt und bietet alle Tools f\u00fcr ein erfolgreiches Projektmanagement.", "messages", "de");
    Translator.add("portal.page.home.content4", "Erstelle deinen<br>Workspace", "messages", "de");
    Translator.add("portal.page.home.content5", "                                        <p>\n                                            CAMPR ist in Workspaces organisiert. Diese zentrale Element erlaubt es dir\n                                            deine Multiprojektumgebung zu organisieren, indem du bestimmte Projekte in\n                                            Arbeitsbereichen gruppierst. Du kannst Projektmitglieder in Workspaces einladen\n                                            und mit ihnen in ausgew\u00e4hlten Projekten zusammenarbeiten. So wird es einfach\n                                            deine Projekte nach Kunden, Umfang oder Teilnehmern zu strukturieren.\n                                        <\/p>\n                                        <p>\n                                            Du kannst au\u00dferdem deinen eigenen Workspace erstellen und zeitgleich\n                                            mit dem gleichen Account Mitglied in anderen Workspaces sein.\n                                        <\/p>\n                                        <p>\n                                            <b>CAMPRs One-Stop-Konzept: ein Account, ein Login, ein pers\u00f6nliches\n                                                Workspace-Dashboard.<\/b>\n                                        <\/p>\n", "messages", "de");
    Translator.add("portal.page.home.create_your_workspace", "Erstelle deinen Workspace", "messages", "de");
    Translator.add("portal.page.home.content6", "Organisiere<br>dein<br>Team", "messages", "de");
    Translator.add("portal.page.home.content7", "                                        <p>\n                                            Die Projektorganisation bildet die Projektteilnehmer hierarchisch ab.\n                                            Das Modul visualisiert das Projektorganisationsdiagramm\n                                            und definiert die Rollen sowie die Beziehungen zwischen den Projektteams.\n                                            Au\u00dferdem k\u00f6nnen individuelle Verteilerlisten f\u00fcr Projektberichte oder Meetingeinladungen\n                                            erstellt werden.\n                                        <\/p>\n", "messages", "de");
    Translator.add("portal.page.home.all_modules", "Alle Module", "messages", "de");
    Translator.add("portal.page.home.content8", "Plane<br>dein<br>Projekt", "messages", "de");
    Translator.add("portal.page.home.content9", "<p>\n                                            Arbeitspakete k\u00f6nnen in Phasen gem\u00e4\u00df der Projektabschnitte gruppiert werden.\n                                            Besonders wichtige Eregnisse im Projekt werden definiert und\n                                            terminiert als Meilensteine.\n                                        <\/p>\n", "messages", "de");
    Translator.add("portal.page.home.content10", "Verwalte<br>deine<br>Aufgaben", "messages", "de");
    Translator.add("portal.page.home.content12", "Erfahre mehr \u00fcber die Idee und das Team hinter <b>CAMPR<\/b>", "messages", "de");
    Translator.add("portal.page.home.content13", "                             <p>Wer steckt hinter CAMPR? Christoph and Manuel reisen als erfahrene Projektmanager \n                                in Ihren Projekten um die Welt. Stets interkulturelle Teams, verschiedene L\u00e4nder und\n                                Branchen.<\/p>\n\n                            <p>Doch immer die selbe Herausforderung: kein Tool konnte unsere Anforderungen an das\n                                professionelle managen globaler Projekte erf\u00fcllen.<\/p>\n\n                            <p>Die L\u00f6sung ist CAMPR. Konzipiert im Wohnmobil, denn die besten Ideen entstehen\n                                abends am Langerfeuer. Webbasiert, plattformunabh\u00e4ngig, installiert auf\n                                firmeneigenen Servern oder einer deutschen Cloud. Modular.<\/p>\n\n                            <p>CAMPR - precise Project Management - nothing else!<\/p>", "messages", "de");
    Translator.add("portal.page.imprint.title", "Imprint", "messages", "de");
    Translator.add("portal.page.imprint.address", "CAMPR GmbH\n<br><a href=\"https:\/\/maps.google.com\/?q=Friedrich-Bergius-Ring+15+97076+W%C3%BCrzburg&amp;entry=gmail&amp;source=g\">Friedrich-Bergius-Ring 15<\/a>\n<br><a href=\"https:\/\/maps.google.com\/?q=Friedrich-Bergius-Ring+15+97076+W%C3%BCrzburg&amp;entry=gmail&amp;source=g\">97076 W\u00fcrzburg<\/a>\n<br>Tel.: <a href=\"tel:+49%20931%202705814\" value=\"+499312705814\" target=\"_blank\">+49 931 270 5814<\/a>\n<br>E-Mail: <a href=\"mailto:info@campr.biz\" target=\"_blank\">info@campr.biz<\/a>\n<br>CEO: Christoph Pohl, Manuel Weiler\n<br>Registered office: W\u00fcrzburg\n<br>\u200bHRB 13625, Amtsgericht W\u00fcrzburg", "messages", "de");
    Translator.add("portal.page.modules.title", "16 Grundlagenmodule", "messages", "de");
    Translator.add("portal.page.modules.subtitle", "Das CAMPR Tool umfasst 16 kostenlose Module, die manuell aktiviert oder auf Basis unseres \"Project Creation Wizard\"-Algorithmus genutzt werden k\u00f6nnen.\n<span class=\"small-separator\"><\/span>\n<b class=\"block\">Weitere Premium-Module werden folgen<\/b>", "messages", "de");
    Translator.add("portal.page.modules.project_contract.desc", " <p>Ziel des Projektvertrages ist es, eine schriftliche Vereinbarung zwischen dem Projektsponsor und Projektmanager. Die Vereinbarung sollte eine kurze Beschreibung der Eckdaten des Projektes, sowie die Nutzung der ben\u00f6tigten Ressourcen f\u00fcr das Vorhaben beinhalten.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.organization.title", "Organisation", "messages", "de");
    Translator.add("portal.page.modules.organization.desc", "<p>Die Projektorganisation listet alle Projektteilnehmer in hierarchischer Ordnung. Dieses Modul visualisiert das Projekt-Organigramm und definiert die Rollen und Beziehungen zwischen den einzelnen Projektteams. Des Weiteren k\u00f6nnen individuelle Verteilerlisten f\u00fcr Berichte und Meetingeinladungen angelegt werden.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.phases_and_milestones.title", "Phasen &amp; Meilensteine", "messages", "de");
    Translator.add("portal.page.modules.phases_and_milestones.desc", "<p>Arbeitspakete k\u00f6nnen gem\u00e4\u00df der Projektabfolge in Phasen gruppiert werden. Besonders wichtige Ereignisse im Projektfortschritt werden als Meilensteine definiert und terminiert.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.task_management.title", "Aufgabenverwaltung", "messages", "de");
    Translator.add("portal.page.modules.task_management.desc", "<p>Die Aufgabenverwaltung bietet einen \u00dcberblick aller Arbeitspakete, die in Verbindung mit dem Projekt stehen. Ein Arbeitspaket ist eine Gruppierung zusammenh\u00e4ngender Aufgaben. Typische Kategorien f\u00fcr gruppierte Aufgaben sind geographische N\u00e4he, technische Disziplin, Technologie oder die Zeit, die f\u00fcr den Abschluss der Aufgabe ben\u00f6tigt wird.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.internal_costs.title", "Interne Kosten", "messages", "de");
    Translator.add("portal.page.modules.internal_costs.desc", "<p>Es ist essentiell, die Projektkosten nicht aus den Augen zu verlieren. Die Kostenplanung erlaubt dir die Kostenkalkulation pro Arbeitspaket und somit auch f\u00fcr das Projekt als Ganzes. Es wird unterschieden zwischen internen und externen Kosten sowie operationalen Kosten und Investment.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.external_costs.title", "Externe Kosten", "messages", "de");
    Translator.add("portal.page.modules.external_costs.desc", "<p>Die Ressourcenplanung erlaubt dir die Kalkulation des ben\u00f6tigten Personalaufkommens f\u00fcr deine Arbeitspakete.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.risks_and_opportunities.title", "Risiken &amp; Chancen", "messages", "de");
    Translator.add("portal.page.modules.risks_and_opportunities.desc", "<p>Eine regelm\u00e4\u00dfige Risikoanalyse ist essentiell, um potentielle Gef\u00e4hrdungen, sowie ungenutze Potentiale zu entdecken und somit den Projekterfolg zu maximieren. Dieses Modul unterst\u00fctzt dich beim Sammeln, Strukturieren, Tracken und Visualisieren der Risiken und Chancen.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.gantt.title", "Gantt Diagramm", "messages", "de");
    Translator.add("portal.page.modules.gantt.desc", "<p>Das Gantt-Diagramm ist eine Standardvidualisierung aller Phasen, Arbeitspakete, Aufgaben und Meilensteine auf einer Zeitschiene bez\u00fcglich der geplanten Projektausf\u00fchrung. Alle Elemente haben einen zugeh\u00f6rigen Start- und Enddatum und werden als einzelne Balken auf der Zeitachse dargestellt. Korrelationen zwischen diesen Elementen, etwa Vorg\u00e4nger- oder Nachfolgeraufgabe, k\u00f6nnen definiert und somit dargestellt werden.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.rasci.title", "RASCI-Matrix", "messages", "de");
    Translator.add("portal.page.modules.rasci.desc", "<p>Die Verantwortlichkeitsmatrix stellt die Rollenverteilung bei der Erledigung der Aufgaben oder Leistungen zur Projektausf\u00fchrung dar. Es ist besonders n\u00fctzlich zur Klarstellung der Rollen und Verantwortlichkeiten in funktions\u00fcbergreifenden Projekten und Prozessen.<\/p>\n<p>RASCI ist ein Akronym, welches die f\u00fcnf Rollen der Prozessausf\u00fchrung eines Arbeitspaketes oder einer Aufgabe beinhaltet: Responsible, Accountable, Supportable, Consulted, und Informed.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.wbs.title", "WBS", "messages", "de");
    Translator.add("portal.page.modules.wbs.desc", "<p>Die Work Breakdown Structure (WBS) ist ein ergebnisorientierte Aufschl\u00fcsselung in kleinere Komponenten. Eine WBS ist eine Schl\u00fcsselfunktion, um die Arbeit des Projektteams in \u00fcberschaubare Sektionen zu teilen. Das Module visualisiert den Breakdown in einer Baumstruktur, beginnend mit den Projektphasen und Arbeitspaketen, Aufgaben und Meilensteinen in den Zweigen. Die Struktur kann innerhalb des Moduls zu Restrukturierungszwecken angepasst werden.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.meetings.title", "Meetings", "messages", "de");
    Translator.add("portal.page.modules.meetings.desc", "<p>CAMPR erleichtert dir die Koordination von Meetings mit Projektteilnehmern. Du kannst Meetings planen, erstellen und Einladungen verschicken. Nutze individuelle Verteilerlisten, um das Meetingprotokoll an alle relevanten Meetingteilnehmer zu verschicken.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.todos.title", "To-Do's", "messages", "de");
    Translator.add("portal.page.modules.todos.desc", "<p>Die zentrale To-Do-Liste f\u00fchrt die vereinbarten oder notwendigen To-Do's deines Projektes auf.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.infos.title", "Infos", "messages", "de");
    Translator.add("portal.page.modules.infos.desc", "<p>Im Info-Modul kannst du allgemeine Informationen, die dein Projekt oder Team betreffen, dokumentieren. Die Informationen k\u00f6nnen beispielsweise die \u00c4nderungen des Projektumfanges, neue Projektmitglieder oder andere neue Ereignisse sein.<\/p>", "messages", "de");
    Translator.add("portal.page.modules.decisions.title", "Entscheidungen", "messages", "de");
    Translator.add("portal.page.modules.decisions.desc", "<p>Im Entscheidungsmodul kannst du Entscheidungen, die w\u00e4hrend der Projektdurchf\u00fchrung getroffen wurden, dokumentieren. <\/p>", "messages", "de");
    Translator.add("portal.page.modules.status_report.title", "Statusreport", "messages", "de");
    Translator.add("portal.page.modules.status_report.desc", "<p>Der Statusbericht liefert einen \u00dcberblick des aktuellen Projektzustandes bez\u00fcglich Services, Deadlines, Ressourcen, Kosten, Organisation und Kontext sowie der geplanten Ma\u00dfnahmen f\u00fcr notwendige Entscheidungen. <\/p>", "messages", "de");
    Translator.add("portal.page.modules.close_down_report.title", "Abschlussbericht", "messages", "de");
    Translator.add("portal.page.modules.content1", "CAMPR<br>ist f\u00fcr<br>jedermann", "messages", "de");
    Translator.add("portal.page.modules.content2", "<p class=\"mt-60\">Wir haben ein Tool geschaffen, das von jedem Projektmanager genutzt werden kann - vom Novizen bis Experten. Die <b>KOSTENLOSE<\/b> Version ist vorgesehen f\u00fcr Nutzer, die CAMPR testen wollen oder in kleinen Teams arbeiten (bis zu 4 Nutzer). <b>Schulen<\/b>, <b>Universit\u00e4ten<\/b> und <b>Wohlt\u00e4tigkeitsorganisationen<\/b> k\u00f6nnen sich bei uns ein <b>spezielles Angebot<\/b> einholen. Alles, was du daf\u00fcr tun musst, ist, uns zu <a href=\"%link%\" class=\"simple-link\"><b>kontaktieren<\/b><\/a><\/p>.", "messages", "de");
    Translator.add("portal.ui.sign_up_now", "Jetzt Registrieren", "messages", "de");
    Translator.add("portal.ui.features", "Features", "messages", "de");
    Translator.add("email.contact.body", "<p>Hallo,<\/p>\n<p>Folgende Nachricht wurde durch das Kontaktformular gesendet.<\/p>\n<p>Email: %email%<\/p>\n<p>Name: %fullname%<\/p>\n<p>Nachricht:<\/p>\n<p>%message%<\/p>", "messages", "de");
    Translator.add("portal.ui.project_duration", "Project Duration", "messages", "de");
    Translator.add("portal.ui.months", "Months", "messages", "de");
    Translator.add("portal.ui.project_budget", "Project Budget", "messages", "de");
    Translator.add("portal.page.register.content18", "Wenn du CAMPR auf firmeneigenen Servern installieren willst, kontaktiere uns und wir werden dir die ben\u00f6tigten Informationen zur Verf\u00fcgung stellen.\nAnsonsten kannst du das Formular ausf\u00fcllen und wir liefern dir <b>das ideale Lizenzmodell f\u00fcr dein Projekt<\/b>.", "messages", "de");
    Translator.add("portal.page.register.content24", "und einer Projektlaufzeit unter", "messages", "de");
    Translator.add("portal.page.register.content25", "<p class=\"mt-30\">\n    Eines unserer Hauptziele ist es, Menschen im Bereich Projekmanagement weiterzubilden und Studenten, jungen Existenzgr\u00fcndern und jeder Art von Wohlt\u00e4tigkeitsorganisation dabei zu helfen, Ihre Managementf\u00e4higkeiten zu verbessern. Wir bieten allen <b>Schulen<\/b>, <b>Universit\u00e4ten<\/b> oder <b>Wohlt\u00e4tigkeitsorganisationen<\/b>, die CAMPR gebrauchen k\u00f6nnen, an, unsere Software kostenlos zu Nutzen. <b>Alles, was du daf\u00fcr tun musst, ist, uns zu kontaktieren.<\/b>\n<\/p>", "messages", "de");
